import React, { Component } from 'react'

export default class Count extends Component {
  render() {
    return (
      <div>
          <h1>当前求和为:0</h1>
          <select ref={c => this.selectNumber = c}>
            <option value="1">1</option>
            <option value="2">2</option>
            <option value="3">3</option>
          </select>
          <button>+</button>
          <button>-</button>
          <button>*</button>
          <button>/</button>


      </div>
    )
  }
}
